import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from "react-responsive-carousel";

function Hero() {
  return (
    <div className="flex flex-col w-full items-center justify-items-center">
      <div className="block w-10/12">
        <div className="relative">
          <Carousel axis="horizontal" showArrows={true} showIndicators={true}>
            <img src="images/carousel-1.jpeg" alt="carousel-1" />
            {/* <p className="legend">Legend 1</p> */}

            <img src="images/carousel-2.jpeg" alt="carousel-2" />
            {/* <p className="legend">Legend 2</p> */}
          </Carousel>
        </div>
      </div>
    </div>
  );
}

export default Hero;
